import React from "react";

import DUMMY_MEALS from "./DummyMeals";
import Meals from "./Meals";

const AvailableMeals = () => {
  const mealItems = DUMMY_MEALS.map((meal) => <li>{meals.name}</li>);

  return (
    <section>
      <ul>{mealItems}</ul>
    </section>
  );
};

export default AvailableMeals;
